import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };
  return (
    <div style={{ display: 'flex', minHeight: '100vh', background: '#f8f9fa' }}>
      {/* Sidebar */}
      <aside style={{
        width: 240,
        background: 'linear-gradient(135deg, #e0e7ff 60%, #f8f9fa 100%)',
        boxShadow: '2px 0 16px #b2b6d622',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: '32px 0',
        borderTopRightRadius: 32,
        borderBottomRightRadius: 32,
      }}>
        <img src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png" alt="Logo" style={{ width: 56, marginBottom: 24 }} />
        <h3 style={{ fontWeight: 800, color: '#181c3a', marginBottom: 32, fontSize: 22 }}>CSInfoTech</h3>
        <nav style={{ width: '100%' }}>
          <Link to="/dashboard" style={sidebarLinkStyle}><i className="bi bi-grid" style={iconStyle}></i> Dashboard</Link>
          <Link to="/add-agent" style={sidebarLinkStyle}><i className="bi bi-person-plus" style={iconStyle}></i> Add Agent</Link>
          <Link to="/upload-list" style={sidebarLinkStyle}><i className="bi bi-upload" style={iconStyle}></i> Upload List</Link>
          <Link to="/agent-lists" style={sidebarLinkStyle}><i className="bi bi-people" style={iconStyle}></i> Agent Lists</Link>
        </nav>
        <div style={{ flex: 1 }} />
        <button onClick={handleLogout} className="btn btn-outline-danger w-75 mt-4">Logout</button>
      </aside>

      {/* Main Content */}
      <main style={{ flex: 1, padding: '40px 32px', background: '#f8f9fa' }}>
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: 32 }}>
          <span style={{ color: '#6a89cc', fontWeight: 600, fontSize: 18, marginRight: 12 }}>Dashboard</span>
        </div>
        {/* Stat Cards */}
        <div style={{ display: 'flex', gap: 24, marginBottom: 32, flexWrap: 'wrap' }}>
          <StatCard title="Today's Money" value="$53,000" change="+55%" icon="ðŸ’°" color="#38d39f" />
          <StatCard title="Today's Users" value="2,300" change="+3%" icon="ðŸ‘¤" color="#6a89cc" />
          <StatCard title="New Clients" value="+3,462" change="-2%" icon="ðŸ§‘â€ðŸ’¼" color="#f76c6c" />
          <StatCard title="Sales" value="$103,430" change="+5%" icon="ðŸ†" color="#f7b731" />
        </div>
        {/* Welcome Card */}
        <div style={{ display: 'flex', gap: 24, flexWrap: 'wrap' }}>
          <div style={{ flex: 1, minWidth: 320, background: '#fff', borderRadius: 18, boxShadow: '0 2px 16px #b2b6d622', padding: 32, marginBottom: 24 }}>
            <h4 style={{ fontWeight: 700, color: '#181c3a', marginBottom: 12 }}>Build by developers</h4>
            <h2 style={{ fontWeight: 800, color: '#6a89cc', marginBottom: 16 }}>Soft UI Dashboard</h2>
            <p style={{ color: '#6c757d', marginBottom: 16 }}>From colors, cards, typography to complex elements, you will find the full documentation.</p>
            <a href="#" style={{ color: '#38d39f', fontWeight: 600, textDecoration: 'none' }}>Read More â†’</a>
          </div>
          <div style={{ flex: 1, minWidth: 320, background: 'linear-gradient(135deg, #6a89cc 60%, #38d39f 100%)', borderRadius: 18, boxShadow: '0 2px 16px #b2b6d622', padding: 32, color: '#fff', marginBottom: 24, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <img src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png" alt="Rocket" style={{ width: 90, marginRight: 24 }} />
            <div>
              <h4 style={{ fontWeight: 700, marginBottom: 8 }}>Work with the rockets</h4>
              <p style={{ marginBottom: 0 }}>Wealth creation is an evolutionarily recent positive-sum game. It is all about who take the opportunity first.</p>
              <a href="#" style={{ color: '#fff', fontWeight: 600, textDecoration: 'underline', marginTop: 8, display: 'inline-block' }}>Read More â†’</a>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

// Sidebar link style
const sidebarLinkStyle = {
  display: 'flex',
  alignItems: 'center',
  gap: 12,
  color: '#181c3a',
  fontWeight: 600,
  fontSize: 16,
  padding: '12px 32px',
  borderRadius: 12,
  margin: '8px 0',
  textDecoration: 'none',
  transition: 'background 0.2s, color 0.2s',
};
const iconStyle = { fontSize: 20, marginRight: 10 };

// Stat Card Component
function StatCard({ title, value, change, icon, color }) {
  return (
    <div style={{
      flex: 1,
      minWidth: 180,
      background: '#fff',
      borderRadius: 16,
      boxShadow: '0 2px 12px #b2b6d622',
      padding: 24,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'flex-start',
      gap: 8,
    }}>
      <span style={{ fontSize: 22, background: color + '22', color, borderRadius: 8, padding: '6px 10px', marginBottom: 8 }}>{icon}</span>
      <span style={{ color: '#6c757d', fontWeight: 600, fontSize: 14 }}>{title}</span>
      <span style={{ fontWeight: 800, fontSize: 22, color: '#181c3a' }}>{value}</span>
      <span style={{ color: change.startsWith('+') ? '#38d39f' : '#f76c6c', fontWeight: 700, fontSize: 14 }}>{change}</span>
    </div>
  );
}

export default Dashboard;
